const element = 
  <Fragment>
    {books.map (book => {
      let {volumeInfo: {title, authors, description, imageLinks: {thumbnail}}} = Book;
    return (
      <div className='bookContainer'>
      <img src= {thumbnail} alt = {title}></img>
      <p>{title}</p>
      <p>{authors}</p>
      <p>{description}</p>
    </div>
      )
})};
  </Fragment>;


ReactDOM.render(element,document.getElementById('root'));


export default Book;
